import React from "react";
import logo from "../../sourse/images/img.png";
import style from "./Header.module.css"
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.esm.js";
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.js";
import { ERROR_ROUTE, HOME_ROUTE } from "../../utils/consts";
import { Link } from "react-router-dom";

const Header = (props) => {

    return (
            <header className={`${style.header}`}>
            <div className={`${style.header__logo}`}>
                <Link to={HOME_ROUTE}>
                    <img src={logo} alt="logotype"/>
                </Link>
            </div>
            <nav className={style.header__navigation}>
                <Link to={ERROR_ROUTE}>Профориентация </Link>
                <Link to={ERROR_ROUTE}>Выбрать вакансию</Link>
                <Link to={ERROR_ROUTE}>Карьера в ГЭНДАЛЬФ</Link>
                <Link to={ERROR_ROUTE}>Стажерство</Link>
                <Link to={ERROR_ROUTE}>Отзывы</Link>
            </nav>
                <div>
                    <button className={style.header__button}>
                        Запись на собеседование
                    </button>
                </div>
            </header>
    );
};

export default Header;
